@LittleIslandNYC is a destination for outdoor music, theater, and dance performances as well as art programs. Accessible by walkways from just off the West Side Highway (at West 13th and 14th Streets), Little Island, at @HudsonRiverPark’s Pier 55, holds 2.4 acres of green space and includes an amphitheater, aka The Amph, overlooking the water. The eye-catching concrete piles jut out of the Hudson River and are connected to one another by lush gardens. Taking the place of the remnants of Pier 54, which was destroyed during Hurricane Sandy, the park welcomes visitors from 6am to 1am, with timed reservations required from noon on. Little Island has partnered with Savory Hospitality to offer coffee, baked goods, salads, sandwiches, drinks, and bites made fresh with local ingredients all day long. Programming includes talks, guided art workshops, and free live concerts. Link in bio.
